import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for at least one product price to appear (by class .product-price)
    await page.waitForSelector('.product-price', { timeout: 5000 });

    // Extract all product prices visible on the page
    const prices = await page.$$eval('.product-price', nodes =>
      nodes.map(node => node.textContent.trim())
    );

    // Take screenshot of the product prices area (first product-card as anchor)
    const firstProductCard = await page.$('.product-card');
    if (firstProductCard) {
      await firstProductCard.screenshot({ path: path.join(screenshotsDir, 'step_2_first_product_card.png') });
      screenshots.push(path.join(screenshotsDir, 'step_2_first_product_card.png'));
    }

    // Also take screenshot of all products grid if present
    const productsGrid = await page.$('.products-grid');
    if (productsGrid) {
      await productsGrid.screenshot({ path: path.join(screenshotsDir, 'step_3_products_grid.png') });
      screenshots.push(path.join(screenshotsDir, 'step_3_products_grid.png'));
    }

    return {
      success: true,
      action: "Extracted all product prices from the page",
      extractedData: {
        prices
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
